            <ul class="nav flex-column">
                <li class="nav-item">
                    <a class="nav-link" href="/home">Home</a>
                </li>
                <li class="nav-item">
                <a class="nav-link" href="/tickets">Tickets</a>
                </li>
            </ul>
       </nav>

